contracts/interfaces/IGaiaDividendDistri.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.15;

import "@openzeppelin/contracts/interfaces/IERC20.sol";
import "./IWETH.sol";

interface IGaiaDividendDistributor {
    event UpdateDepositor(address depositor, bool status);
    event EmergencyWithdraw(address token, uint256 amount);
    event Distribute(address token, uint256 amount, bytes32 merkleRoot, uint256 rewardId);
    event Claim(address user, uint256 rewardId, address token, uint256 amount);

    struct Reward {
        address token;
        uint256 amount; //for archiving
        bytes32 merkleRoot;
    }

    function WETH() external view returns (IWETH);

    function rewardsCount() external view returns (uint256);

    function rewards(uint256 id) external view returns (Reward memory);

    function isRewardCollected(address user, uint256 rewardId) external view returns (bool);

    function depositReward(
        address token,
        uint256 amount,
        bytes32 merkleRoot
    ) external payable returns (uint256 rewardId);

    function claimRewards(
        uint256[] calldata rewardIds,
        uint256[] calldata amounts,
        bytes32[][] calldata proof
    ) external;
}

